import Axios from "axios";
import { DOMAIN } from "../../services/domainUrl";
import { GET_LIST_PAGINATION } from "../constants/ListClientPagination";

export const getListClientPagination = (maNhom, soTrang) => {
    return async (dispatch) => {
        try {
            const res = await Axios({
                method: "GET",
                url: `${DOMAIN}QuanLyNguoiDung/LayDanhSachNguoiDungPhanTrang?MaNhom=${maNhom}&soTrang=${soTrang}&soPhanTuTrenTrang=5`
            })
            dispatch({
                type: GET_LIST_PAGINATION,
                payload: res.data
            })
        } catch (error) {
            console.log(error.response);
        }
    }
}

export const getListSearchClientPagination = (maNhom, tuKhoa, soTrang) => {
    return async (dispatch) => {
        try {
            const res = await Axios({
                method: "GET",
                url: `${DOMAIN}QuanLyNguoiDung/LayDanhSachNguoiDungPhanTrang?MaNhom=${maNhom}&tuKhoa=${tuKhoa}&soTrang=${soTrang}&soPhanTuTrenTrang=5`
            })
            console.log(res.data);
            dispatch({
                type: GET_LIST_PAGINATION,
                payload: res.data
            })
        } catch (error) {
            console.log(error.response);
        }
    }
}
